  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          {helloText}
        </p>
        <a
          className="App-link"

          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        {count}
        <Button onClick = {incrementClick}>PLUS </Button>
        <Button onClick = {incrementClickTwo}>Minus</Button>

      </header>
    <div>

</div>
</div>
  );
}

export default DopComponent;
